import React, { useState, useEffect, useCallback } from 'react';
import { Box, TextField, Button, Grid, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, MenuItem, Select, InputLabel, FormControl, CircularProgress } from '@mui/material';
import { useNavigate, useParams } from 'react-router-dom';
import axios from 'axios';
import AlertMessage from '../../components/AlertMessage';
import { isAuthenticated } from '../../utils/auth';

const CrearHito = () => {
    const { proyectoId } = useParams(); // Extraer proyectoId de la URL
    const [showAlert, setShowAlert] = useState(null); // Estado para las alertas
    const [titulo, setTitulo] = useState('');
    const [descripcion, setDescripcion] = useState('');
    const [fechaInicio, setFechaInicio] = useState('');
    const [fechaFin, setFechaFin] = useState('');
    const [estado, setEstado] = useState('Pendiente');
    const [proyecto, setProyecto] = useState(null);
    const [hitos, setHitos] = useState([]);
    const navigate = useNavigate();

    // Función general para realizar peticiones
    const makeRequest = async (method, url, data = {}) => {
        const token = localStorage.getItem('token');
        if (!token) {
            setShowAlert({
                severity: 'error',
                message: 'No se encontró el token de autenticación.',
            });
            return;
        }

        const config = { headers: { 'x-auth-token': token } };
        try {
            const response = await axios[method](url, data, config);
            return response.data;
        } catch (error) {
            console.error('Error:', error.response || error);
            setShowAlert({
                severity: 'error',
                message: error.response?.data?.msg || 'Hubo un error al realizar la solicitud.',
            });
            return null;
        }
    };

    // Obtener proyecto y hitos
    const fetchProyecto = useCallback(async () => {
        const data = await makeRequest('get', `http://localhost:5000/api/hitos/proyecto/${proyectoId}`);
        if (data) {
            setProyecto(data);
        } else {
            setShowAlert({
                severity: 'error',
                message: 'No se encontró el proyecto.',
            });
        }
    }, [proyectoId]);

    const fetchHitos = useCallback(async () => {
        const data = await makeRequest('get', `http://localhost:5000/api/hitos/proyecto/${proyectoId}`);
        if (data) {
            setHitos(data);
        } else {
            setHitos([]);
        }
    }, [proyectoId]);

    useEffect(() => {
        if (!isAuthenticated()) {
            navigate('/login');
        } else {
            fetchProyecto();
            fetchHitos();
        }
    }, [navigate, fetchProyecto, fetchHitos]);

    // Manejo del formulario
    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!titulo || !descripcion || !fechaInicio || !fechaFin) {
            setShowAlert({
                severity: 'error',
                message: 'Todos los campos son obligatorios.',
            });
            return;
        }

        // Verifica que proyectoId tenga un valor válido
        if (!proyectoId) {
            setShowAlert({
                severity: 'error',
                message: 'ID del proyecto no encontrado.',
            });
            return;
        }

        // Crear el nuevo hito con el proyectoId incluido
        const newHito = { 
            titulo, 
            descripcion, 
            fechaInicio, 
            fechaFin, 
            estado,
            proyectoId // Agregar el proyectoId al cuerpo de la solicitud
        };

        // Realizar la solicitud POST
        const response = await makeRequest('post', 'http://localhost:5000/api/hitos/register', newHito);

        if (response) {
            setShowAlert({
                severity: response.success ? 'success' : 'error',
                message: response.msg || (response.success ? 'Hito creado correctamente.' : 'Error al crear el hito.'),
            });

            if (response.success) {
                // Limpiar el formulario
                setTitulo('');
                setDescripcion('');
                setFechaInicio('');
                setFechaFin('');
                setEstado('Pendiente');

                // Obtener la lista de hitos actualizada
                fetchHitos();
            }

            // Limpiar la alerta después de 2 segundos
            setTimeout(() => {
                setShowAlert(null);
            }, 2000); // 2000ms = 2 segundos
        }
    };

    return (
        <Box sx={{ padding: 5, maxWidth: 1000, margin: 'auto' }}>
            {/* Mostrar la alerta si hay alguna */}
            {showAlert && (
                <AlertMessage
                    severity={showAlert.severity}
                    message={showAlert.message}
                    autoHideDuration={2000}
                    sx={{ mb: 4 }}
                />
            )}

            <Typography variant="h4" gutterBottom align="center">
                Crear Nuevo Hito
            </Typography>

            <form onSubmit={handleSubmit}>
                <Grid container spacing={2}>
                    {/* Campo para Título del Hito */}
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Título del Hito"
                            value={titulo}
                            onChange={(e) => setTitulo(e.target.value)}
                            required
                            variant="outlined"
                        />
                    </Grid>

                    {/* Campo para Descripción */}
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Descripción"
                            value={descripcion}
                            onChange={(e) => setDescripcion(e.target.value)}
                            required
                            variant="outlined"
                        />
                    </Grid>

                    {/* Campo para Fecha de Inicio */}
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Fecha de Inicio"
                            type="date"
                            value={fechaInicio}
                            onChange={(e) => setFechaInicio(e.target.value)}
                            required
                            variant="outlined"
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </Grid>

                    {/* Campo para Fecha de Fin */}
                    <Grid item xs={12} sm={6}>
                        <TextField
                            fullWidth
                            label="Fecha de Fin"
                            type="date"
                            value={fechaFin}
                            onChange={(e) => setFechaFin(e.target.value)}
                            required
                            variant="outlined"
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </Grid>

                    {/* Campo para Estado del Hito */}
                    <Grid item xs={12} sm={6}>
                        <FormControl fullWidth required variant="outlined">
                            <InputLabel>Estado del Hito</InputLabel>
                            <Select
                                value={estado}
                                onChange={(e) => setEstado(e.target.value)}
                                label="Estado del Hito"
                            >
                                <MenuItem value="Pendiente">Pendiente</MenuItem>
                                <MenuItem value="En Progreso">En Progreso</MenuItem>
                                <MenuItem value="Finalizado">Finalizado</MenuItem>
                            </Select>
                        </FormControl>
                    </Grid>

                    {/* Botón para enviar el formulario */}
                    <Grid item xs={12}>
                        <Button
                            type="submit"
                            variant="contained"
                            color="primary"
                            fullWidth
                            sx={{ padding: '12px', fontSize: '16px' }}
                        >
                            Crear Hito
                        </Button>
                    </Grid>
                </Grid>
            </form>

            {/* Mostrar la tabla de hitos */}
            <TableContainer component={Paper} sx={{ marginTop: 4 }}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Título</TableCell>
                            <TableCell>Descripción</TableCell>
                            <TableCell>Fecha Inicio</TableCell>
                            <TableCell>Fecha Fin</TableCell>
                            <TableCell>Estado</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {hitos.map((hito) => (
                            <TableRow key={hito._id}>
                                <TableCell>{hito.titulo}</TableCell>
                                <TableCell>{hito.descripcion}</TableCell>
                                <TableCell>{hito.fechaInicio}</TableCell>
                                <TableCell>{hito.fechaFin}</TableCell>
                                <TableCell>{hito.estado}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Box>
    );
};

export default CrearHito;
